  const [login,setlogin] = useState([]);
  const [loading,setloading] = useState(false);

  const ref = firebase.firestore().collection("login");

  if (loading) {
    return <h1>Loading...</h1>;
  }

  return (

    <Fragment>
      <Navbar/>
      <div>
      <BrowserRouter>
          <Switch>
            <Route path="/signup" component={Signup} />
            <Route path="/Login" component={Login} />

          </Switch>
        </BrowserRouter>
      </div>
    </Fragment>

  )
}



export default app;
